import React from 'react';
import * as Icons from 'react-icons/bs';

export const SearchIcon = Icons.BsSearch;
export const ChartIcon = Icons.BsBarChart;
export const GearIcon = Icons.BsGear;
export const FileIcon = Icons.BsFileText;
export const FilterIcon = Icons.BsFilter;
export const SaveIcon = Icons.BsSave;
export const TrashIcon = Icons.BsTrash;
